      "description": "Apple TV app is the home of Apple TV+, MLS Season Pass and more.\n\nWith the Apple TV app, you can:\n• Watch critically acclaimed Apple Original series and films on Apple TV+, like The Morning Show, Ted Lasso, Foundation, Hijack, CODA, Ghosted and more – with new releases every month.\n• Watch live sports such as MLS Season Pass, with access to every live Major League Soccer regular-season match, the entire playoffs and Leagues Cup, all with no blackouts.\n• Buy or rent newly-released movies or explore the catalogue of over 100,000 movies and shows – including the largest selection of 4K HDR titles.\n• Try Apple TV channels, including BBC iPlayer, ITVX, All 4 and more. Subscribe to just the channels you want and share with your family. Channels play on the Apple TV app ad-free, online or off — no additional apps, accounts or passwords needed.\n• Discover shows and movies from over 100 video streaming apps, including Disney+, Prime Video, NOW, Paramount+ and more, with personalised recommendations from all of them in one place.\n• Sign in with your pay-TV subscription to unlock on-demand shows and movies, as well as live sport included with your subscription.\n• Find the Apple TV app on iPhone, iPad, Apple TV and Mac, as well as Samsung and LG smart TVs, Amazon Fire TV, Roku and more smart TVs and streaming devices.\n\nApple TV app makes watching TV easier:\n\n• Up Next – your personal watchlist – helps you quickly find and watch your favourites, plus resume what you are already watching from the moment you left off, across all your devices.\n• Browse sports to see live and upcoming games for both national and local sport. Choose your favourite teams to automatically add games to Up Next and receive notifications for close-run games and more.\n• Easily find all of your purchased movies and shows in the Library tab. Browse by recently added, downloaded, genre and more.\n• Stream over a Wi-Fi or mobile connection, or download to watch offline.\n\nRequirements:\n\n• iOS devices using iOS 12.3 or later\n• Some features require internet access over a Wi-Fi or mobile data connection\n• HDR video playback may not be available for all content or on all devices\n\nIf you subscribe to any Apple TV channels, payment will be charged to your Apple ID account at the confirmation of purchase. Subscriptions automatically renew unless they are cancelled at least one day prior to the end of the current period. Your account will be charged for renewal within one day prior to the end of the current period. Simultaneous streams may be limited on a per-subscription basis. The availability of Apple TV features, channels and related content may vary depending on the country or region from which you attempt to access them. You can manage and cancel your subscriptions by going to your Settings on the Apple TV app after purchase. See https://www.apple.com/legal/privacy/en-ww for the Privacy Policy. Apple TV app Terms and Conditions can be found at https://www.apple.com/uk/legal/internet-services/itunes/uk/terms.html",
