      "description": "The Unofficial app for finding Netflix Original Release dates, quickly and easily. You can NOT watch or stream shows or movies in this app, this app is an informational tool only. \n\nQuickly find all scheduled Netflix Original release dates, then get notified about changes and updates to the show or movie, including notifications about your favourite actors.\n\nWith Originals you can be the first person to know about a new season announcement and release date!\n \n- Set reminders for your favorite series release dates.\n- Notifications about new seasons and episodes, and production changes,\n- Follow actors and get notified about new shows and movies they are in,\n- Smart Subscriptions to help you save on streaming services,\n- Track your shows/movies watched,\n- Track watched progress,\n- Chat and discuss your favorite movies, shows, seasons, and episodes.\n- Filter by Series, Movies or Documentaries,\n- Follow actors and get updated on changes,\n- Notifications for new seasons, or part seasons,\n- Notification when show is released,\n- List of favourite shows, movies,\n- Browse and Search for Original Shows/Movies,\n- Browse by popular, rating, date, show or movie,\n- Watch Trailers,\n- Filter upcoming by date, title, media type,\n- Filter by Release date,\n \n \nOriginals is funded by ads, if you choose to purchase Originals Pro to hide these ads, unlock Smart Subscriptions, Premium notifications, and unlimited favorites and follows, payment will be charged to your iTunes account, and your account will be charged for renewal 24 hours prior to the end of the current period. Auto-renewal may be turned off at any time by going to your settings in the iTunes Store after purchase.\n \nPurchasing Originals Pro will not allow you to stream or watch any content, shows, or movies.\n \nPrivacy policy: https://netflix.originals.watch/privacy\nTerms of use: https://netflix.originals.watch/terms\n_________\n \nMetadata, artwork and images are provided by TMDb, which is a community maintained movie database.\n_________\n \nDisclaimer: This app can NOT stream or connect to Netflix, and is ONLY an informational tool, using publicly available information, to help you keep track of all your favourite content.\n \nThis product and/or service is not affiliated with, endorsed by or in any way associated with Netflix Inc. or its products and services. Netflix, and their respective logos are trademarks or registered trademarks of Netflix, Inc.",
