      "description": "Available exclusively for Netflix members.\n\nMix and mingle with sexy singles competing for your affection in this game based on the hit series. Will you go for love or give into temptation?\n\nIf you love this reality dating series, now's your chance to be a part of it! Personalize your avatar before heading to the beach to join the other stunning contestants as they compete to take home the prize fund. Will they find love and emotional growth following Lana's infamous rules, or will they give in to physical desire? Whether you choose to play it sweet, cool or naughty — the romantic possibilities are plentiful, and you're always in the driver's seat. \n\nFeatures:\n\n• Want to experience what it's like to be on a dating show with a twist? Play the game through episodes that build the narrative and choose to follow — or break — Lana's rules, just like a real-life contestant.\n• Who's your type? Choose from a diverse pool of possible love interests and build different relationships with a wide variety of hotties. \n• Are you ready to make meaningful connections? Your relationship choices directly affect your popularity, player stats and the amount of remaining virtual prize money.  \n• Ever wonder what could have been? Here you don't have to — replay to your heart's content to unlock different endings and see what other matches bring once an entire season is played through. \n\n- Developed by Nanobit.",
