      "description": "NETFLIX MEMBERSHIP REQUIRED.\n\nFind romance with “Emily in Paris,” community in “Virgin River” or unexpected choices in the “Love Is Blind” pods. Between “Perfect Match” shenanigans and “Selling Sunset” drama, there are so many options in this collection — which story will you choose? You’re the main character in this interactive story game featuring an array of stories based on Netflix's hit shows and films. \n\n\"Netflix Stories\" is a growing library of adventures ready anytime, anywhere. New stories from your favorite shows and movies will be added frequently, so there will be many more adventures to explore!\n\nONE GAME, MANY POSSIBILITIES — CHOOSE FROM A COLLECTION OF INTERACTIVE STORIES BASED ON HIT NETFLIX SHOWS AND MOVIES: \n\nPLAY \"EMILY IN PARIS\" AND FIND ROMANCE IN THE CITY OF LOVE\n\n\"Emily in Paris\" — Say “oui” to possibility. Follow your heart and live out your own story set in the City of Love in this interactive story based on the hit series.\n \nWhen you accept the job of a lifetime at an esteemed fashion magazine, you jet off to start your next chapter in Paris. Soon, you'll discover that the iconic city is full of friends, new challenges and no shortage of eligible suitors. Every choice you make will lead you closer to the top of the fashion industry… or deeper into romance.\n\nSMALL-TOWN LOVE, ROMANCE AND COMMUNITY IN \"VIRGIN RIVER\"\n\n\"Virgin River\" — Is small-town life part of your story? Escape to the comfort and beauty of Virgin River to find romance and community where you least expect it.\n\nDATING DRAMA IN \"PERFECT MATCH\"\n\n\"Perfect Match\" — Join beautiful singles on the beach in a dating competition simulation inspired by \"Perfect Match.\" Will you choose love, power or chaos? \n\n\"SELLING SUNSET\" AND MORE STORIES COMING SOON\n\n\"Selling Sunset\" — Welcome to The Oppenheim Group! As the newest agent at LA’s top luxury real estate brokerage, you'll need to sell your way up to win a dream listing. Immerse yourself in a world where designer clothes, deluxe accessories and high-end cars are all part of the game.\n\nBut to prove yourself, you’ll have to navigate demanding clients, office drama and cutthroat competition. Do you really have what it takes to make it in the city of the rich and famous?\n\nMORE ABOUT \"NETFLIX STORIES\"\n\n\"Netflix Stories\" puts you in the center of the action, where you can interact with characters from your favorite shows and movies and influence how each narrative unfolds. Choose a story and dive in.\n\nCustomize your character, choose your story — love, romance or drama — and make choices that are right for you. Welcome to the interactive world of \"Netflix Stories.\" \n\n- Created by Boss Fight, a Netflix Game Studio.",
